import React from 'react';
import CardList from '../../components/CardList/CardList';

const FavoritePage = (props) => {

    const { closeModal, addToCart, favorite, setModalProps, setIsModalActive, addToFavorite, } = props

    return (

        <CardList closeModal={closeModal} addToCart={addToCart} addToFavorite={addToFavorite} setModalProps={setModalProps} setIsModalActive={setIsModalActive} data={favorite} />

    );
}

export default FavoritePage;
